function getGoodInput () {
  var upperLimit = prompt("What is the upper limit?");
  if (isNaN(upperLimit)) {return("error"); }
  if (!isInt(upperLimit)) {return("error"); }
  if (upperLimit <= 2) {return("error"); }
  return Number(upperLimit);
}

function findTwinPrimes(upperLimit, prime) {
var count = 0;
var twins = [];
var greatestOdd = 0;
if (upperLimit % 2 !== 0) {
  greatestOdd = upperLimit;
} else {
  greatestOdd = upperLimit - 1;
}
for (var i = greatestOdd; i > 2; i -= 2) {
  if (prime[i] === true && prime[i-2] === true) {
    count += 1
    if (twins.length === 0 || twins.length === 2) {
      twins.push(i, i-2);
    }
  }
}
if (twins.length === 2) {
  alert("twin prime: " + twins[0] + ", " + twins[1]);
} else if (twins.length === 4) {
  alert("twin prime: " + twins[0] + ", " + twins[1]);
  alert("twin prime: " + twins[2] + ", " + twins[3]);
}
alert("number of twin primes: " + count);
}

function isInt ( val ) {
  if ( isNaN(val)) { return false; }
  return (val%1) === 0;
}

function findPrimes(upperLimit) {
var prime = []; 
prime[0] = false;
prime[1] = false;
for (var i = 2; i <= upperLimit; i++) {
  prime[i] = true;
  for (var j = 2; j < i; j++) {
    if (i % j === 0) {
      prime[i] = false;
    }
  }
}  
  return prime;
}

