function myMain() {
  while (true) {
    var upperlimit = getGoodInput();
  	if (upperlimit === "error") {alert("error");}
    else {break;}
  }
  var prime = []; 
  for (var i = 0; i < upperlimit; i++) {
    prime[i] = true;
  }
  prime[0] = false;
  prime[1] = false;
  var second_limit = Math.sqrt(upperlimit);
  for (var i = 2; i < second_limit; i++) {
    if (prime[i] = true) { 
      for (var k = (i*2); k < upperlimit; k+= i) {
        prime[k] = false;
      }
    }
  }
  alert(prime);
  var twins = [];
  for (var i = upperlimit - 1; i > 2; i--) {
    if (prime[i] === true && prime[i-2] === true) {
      twins.push(i, i-2);
    }
  }
    if (twins.length === 2) {
      alert("twin prime: " + twins[0] + ", " + twins[1]);
      alert("number of twin primes: " + (twins.length/2));
    }
    if (twins.length > 2) {
      alert("twin prime: " + twins[0] + ", " + twins[1]); 
      alert("twin prime: " + twins[2] + ", " + twins[3]);  
      alert("number of twin primes: " + (twins.length/2));
    }
}



function getGoodInput () {
  var upperLimit = prompt("What is the upper limit?");
  if (isNaN(upperLimit)) {return("error"); }
  if (!isInt(upperLimit)) {return("error"); }
  if (upperLimit <= 2) {return("error"); }
  return Number(upperLimit);
}

function isInt ( val ) {
  if ( isNaN(val)) { return false; }
  return (val%1) === 0;
}

function isPrime(j) {
  for (var i = 2; i < j; i++) {
    if (j % i === 0) {return false;}
    else {return true;}
  }
}

function isTwinPrime(i){
  return (isPrime(i) && (isPrime(i-2)));
}

