      var hand = makeDeckObj(0);
      for (var c=0; c<num; c++) {
        hand.addCard(this.cards[c]);
      }
      //var hand=this.cards.slice(0,num);
      this.cards=this.cards.slice(num);
      this.numCards -=num;
      return hand;
    },

    show:function() {
      var nameStr="";
      for(var c=0; c<this.numCards; c++) {
        nameStr += this.cards[c].getName() + ",";}
      alert(this.numCards + " cards: "+nameStr);
