      sqrtNum=Math.sqrt(newNum);
      arrThree[z]=chop3(sqrtNum);}
    if (arrOne[z]===arrTwo[z]) {
      newNum=arrOne[z];
      sqrtNum=Math.sqrt(newNum);
      arrThree[z]=chop3(sqrtNum);}
  }
  showArray(arrThree);
} 

function chop3 (num) {
  var truncNum = (Math.trunc(num*1000))/1000;
  return truncNum;
}

function showArray (arr) {
  for (var i=0; i<arr.length; i++) {
    alert(arr[i]);
  }
}

function validate (data) {
  if (isNaN(data)) {return("error");}
  if (!isInt(data)) {return("error");}
  if (data<1) {return ("error");}
  return ("ok");
}

function isInt(val) {
  if (isNaN(val)) {return false;}
  return (val%1)===0;
}

