  var accum = 0;

  for (var i = array.length; i>0; i--) {
    accum = accum+array[i-1]
  }

  return accum;

}

function arrayRecursion(array) {

  if (array.length===0) {return 0;}
  return array[0] + arrayRecursion(array.slice(1));

