function intMult (a, b) {
  if (a < 0) {a = Math.ceil(a); return;}
  if (b < 0) {b = Math.ceil(b); return;}
  if (a > 0) {a = Math.floor(a); return;}
  if (b > 0) {a = Math.floor(b); return;}
