function myMain() {
  var text = prompt("Give us the data"); 
  var initial_team = text.split("!");
  var numGames = initial_team[0]; 
  var team = [];
  for (var i = 0; i < initial_team.length - 1; i++) {
    team[i] = makeNewAthlete(initial_team[i+1]);
  }
  var points = 0;
  for (var i = 0; i < team.length; i++) {
    points = points + team[i].totalPts;
  }
  var ppg = points / numGames;
  alert("team ppg: " + trunc(ppg));
  var highest = 0;
  var player;
  for (var i = 0; i < team.length; i++) {
    if (team[i].totalPts > highest) {
      highest = team[i].totalPts;
      player = team[i];
    }
  }
  alert("high total: " + player.name + ", " + trunc(highest));
  var highestPpg = 0;
  var object;
  for (var i = 0; i < team.length; i++) {
    if (team[i].ptsPerGame > highestPpg) {
      highestPpg = trunc(team[i].ptsPerGame);
      object = team[i];
    }
  }
  alert("high ppg: " + object.name + ", " + trunc(highestPpg));
  while (true) {
    var id = prompt("ID number?");
    if (id === 'done') {break;} 
    id = Number(id);
    for (var i = 0; i < team.length; i++) {
      if (id === team[i].id) {
      alert("(" + id + ")" + team[i].name + ": " + team[i].fta + " fta, " + team[i].ftm + " ftm, " + trunc((team[i].ftPct)) + "%");
    }
  }
}
}

function makeNewAthlete(line) {
  var player = line.split("#");
  var athlete = {};
    athlete.id = Number(player[0]);
    athlete.name = player[1];
    athlete.games = Number(player[2]);
    athlete.fga = Number(player[3]);
    athlete.fgm = Number(player[4]);
    athlete.fta = Number(player[5]);
    athlete.ftm = Number(player[6]);
  athlete.totalPts = (athlete.fgm *2) + athlete.ftm;
    athlete.fgPct  = ((athlete.fgm/athlete.fga) * 100);
    athlete.ftPct =  ((athlete.ftm/athlete.fta) * 100);
    athlete.ptsPerGame = trunc((athlete.totalPts/athlete.games));
    return (athlete);
}

function trunc ( num ) {
  var val = Math.floor((num*100))/100;
  return val;
}







