"use strict" ;

function totalPts(fgm, ftm) {
	var totalPts = parseInt(fgm * 2) + parseInt(ftm);
	return totalPts;
	//returns integr >= 0 total points scored over the season
	//(field goals made * 2 )+ free throws made
}
function fgPct(fgm, fga) {
	var fgPct = (fgm / fga * 100).toFixed(2);
	return fgPct;
	// returns a real number between 0-100 (ftm/fsa)100 trunc 2 decimal places
}
function ftPct(ftm, fta) {
	var ftPct = parseFloat(ftm / fta * 100).toFixed(2);
	return ftPct;
	// returns a real number between 0-100 (ftm/fta)100 trunc 2 decimal places
}
function ptsPerGame(games, fgm, ftm) {
	var ptsPerGame = (totalPts(fgm, ftm) / games).toFixed(2);
	return ptsPerGame;
	//returns a real number >=0.total points scored the player was integer
	// total points scored by player/ games played by player trunc 2
}
function makeNewAthlete(id, name, games, fga, fgm, fta, ftm, numGames) {
	var athlete = new Object();
	athlete.numGames = numGames;
	athlete.id = id; // id number
	athlete.name = name; // first & last name
	athlete.games = games; // # of games played >=0
	athlete.fga = fga; //field goal shots attempted >=0
	athlete.fgm = fgm; // field goals shots made <=
	athlete.fta = fta; //free throws attempted >=0
	athlete.ftm = ftm; //free throws made <=

	athlete.totalPts = totalPts(fgm, ftm);
	athlete.fgPct = fgPct(fgm, fga);
	athlete.ftPct = ftPct(ftm, fta);
	athlete.ptsPerGame = ptsPerGame(numGames, fgm, ftm);

	return athlete;
}
function stringSplt(input) {
	var words;
	var count = 0;
	var id;
	var name;
	var games;
	var fga;
	var fgm;
	var fta;
	var ftm;
	var teamArr = [count];

	var line = input.split('!');
	var numGames = line[0];

	for (var i = 1; i < line.length; i++) {
		words = line[i].split('#');
		for (var j = 0; j <= words.length; j++) {
			id = words[0];
			name = words[1];
			games = words[2];
			fga = words[3];
			fgm = words[4];
			fta = words[5];
			ftm = words[6];
		}
		count++;
		teamArr[i - 1] = makeNewAthlete(
			id,
			name,
			games,
			fga,
			fgm,
			fta,
			ftm,
			numGames
		);
	}
	return teamArr;
}
function output(teamArr){
	var htName;
	var ptName;
	var maxTotal = 0;
	var maxPpg = 0;
	var teamPts = 0;
  for (var i = 0; i < teamArr.length; i++) {
		teamPts += parseFloat(teamArr[i].ptsPerGame);
		if (parseFloat(teamArr[i].totalPts) > maxTotal) {
			maxTotal = teamArr[i].totalPts;
			htName = teamArr[i].name;
		}
		if (parseFloat(teamArr[i].ptsPerGame) > maxPpg) {
			maxPpg = teamArr[i].ptsPerGame;
			ptName = teamArr[i].name;
		}
	}

	alert('team ppg: ' + teamPts);
	alert('high total: ' + htName + ', ' + maxTotal);
	alert('high ppg: ' + ptName + ', ' + maxPpg);
}

