    shuffle: function(times) {
  		for(var i=1; i<=times; i=i+1) {
    		var slot1= genRandomInt(0, this.numCards-1);
    		var slot2= genRandomInt(0, this.numCards-1);
    		var temp= this.cards[slot1];
    		this.cards[slot1]=this.cards[slot2];
    		this.cards[slot2]=temp;
        }
    },

    deal:function(num) {
      var hand=this.cards.slice(0,num);
      this.cards=this.cards.slice(num);
      this.numCards -=num;
      return hand;
    },

    show:function() {
      var nameStr="";
      for(var c=0; c<this.numCards; c++) {
        nameStr += this.cards[c].getName() + ",";}
      alert(this.numCards + " cards: "+nameStr);
    },
    init: function() {for (var c=0; c<this.numCards; c=c+1) {this.cards[c]=makeCard(c);}},
    getCard: function(n) {if (n>=1 && n<=this.numCards) {return this.cards[n-1];} return null;},
    size: function() {return this.cards.length;},
  };
  deck.init();
  return(deck);
};

function genRandomInt(min,max) {
  return Math.floor(Math.random()*((max-min)+1))+min;
}

