        if (gen[r+1][c-1]===ON) { ct++; } 
        if (gen[r+1][c]===ON)   { ct++; }
        if (gen[r+1][c+1]===ON) { ct++; }
        if (gen[r][c-1]===ON) { ct++; }
        if (gen[r][c+1]===ON) { ct++; }
        if ( gen[r][c]===ON && ( ct<2 || ct>3 ) ) { ngen[r][c] = OFF; } 
        else if ( gen[r][c]===OFF && ct===3 )     { ngen[r][c] = ON; } 
        else                                      { ngen[r][c] = gen[r][c]; }
      }
    }
    clearCanvas();
    tgen=gen; gen=ngen; ngen=tgen; // swap gens and display new gen

    /*
    for (var r=1; r<nr-1; r+=1) {
      for (var c=1; c<nc-1; c+=1) { 
        //gen[r][c] = ngen[r][c]; 
        if (gen[r][c]===ON) { putPoint(r*6,c*6,PIC); }
      }
    }   
    */
    //put image pixels to image Data
    for (var y = 0; y < HGT; ++y) {
      for (var x = 0; x < WID; ++x) {
        if (gen[x][y]===ON) {
          var index = (y * WID + x) * 4;
          var value = 0;
          data[index] = value; index++;  // red
          data[index] = value; index++;  // green
          data[index] = value; index++;  // blue
          data[index] = 255;             // alpha
        }
      }
    }
    PIC.putImageData(imgData, 0, 0);

  }, 
  500);  // every half second

  return;
}

